import React from "react";

class ContactList extends React.Component {
    render() {
        console.log(this.props);
        return (
            <ol>
                {this.props.contacts.map( contact => (
                    <li key={contact.id} className="contact-list-iyem">
                        {contact.name}
                    </li>
                ))}
            </ol>
        )
    }
}

export default ContactList;
